rds Reported","SAVE UP TO":"Save up to {{advantage, number(minimumFractionDigits: 0)}}","SHOW LESS":"Show less","SHOW MORE":"Show More","SIGN ME UP FOR THE NEWSLETTER":"Sign me up for the newsletter","UNKNOWN":"-","VEHICLE":"Vehicle","VEHICLE_ID":{"LOT_NUMBER":"Lot # {{lotNumber}}","STOCK_NUMBER":"Stock # {{stockNumber}}","VIN":"VIN {{vin}}"},"YES":"Yes"},"DAMAGE":{"ALL OVER":"OVERALL ","BACK END":"BACK END","BIOHAZARD":"BIOHAZARD","BIOHAZARD/CHEMICAL":"BIOHAZARD/ CHEMICAL \t","FIRE":"FIRE","FIRE/BURN":"FIRE/BURN \t","FLOOD":"FLOOD","FRAME DAMAGE":"FRAME DAMAGE","FRONT END":"FRONT END ","HAIL":"HAIL ","LEFT REAR":"LEFT REAR","LEFT SIDE":"LEFT SIDE ","MECHANICAL":"MECHANICAL ","MINOR DENT/SCRATCHES":"MINOR DENTS/SCRATCHES","MINOR DENTS/SCRATCHES":"MINOR DENTS/SCRATCHES","MISSING/ALTERED VIN":"MISSING/ ALTERED VIN ","NORMAL WEAR":"NORMAL WEAR ","OVERALL":"OVERALL ","PARTIAL REPAIR":"PARTIAL REPAIR","PARTIAL/INCOMPLETE REPAIR":"PARTIAL/ INCOMPLETE REPAIR\t","REAR":"REAR","REAR END":"REAR END","REJECTED REPAIR":"REJECTED REPAIR \t","REPOSSESSION":"REPOSSESSION ","RIGHT REAR":"Right rear","RIGHT SIDE":"RIGHT SIDE ","ROLLOVER":"ROLLOVER","SIDE":"SIDE","STRIPPED":"STRIPPED","TOP ROOF":"TOP ROOF \t","UNDERCARRIAGE":"UNDERCARRIAGE ","VANDALISM":"VANDALISM","VP-REPLACED VIN":"VP-REPLACED VIN ","WATER":"WATER/FLOOD"},"GRADE":{"A":"Excellent","B":"Good","C":"Average","D":"Bad","E":"Poor","F":"Irreparable"},"LANGUAGES":{"AR":"","BG":"","DE":"Deutsch","EN":"English","ES":"Espaol","FR":"Franais","KA":"","PL":"Polski","RO":"Romn","RU":"","UA":"","UK":""},"ODOMETER_STATUS":{"ACTUAL":"ACTUAL\n","NOT ACTUAL":"NOT ACTUAL","NOT REQUIRED/EXEMPT":"Exempt"},"BRANDS":{"_DESCRIPTIONS":{"00_CLEAR":"No brand exists for the vehicle.","01_FLOOD DAMAGE":"Vehicle damaged by freshwater flood (or it is unknown whether the damage was caused by fresh water or salt water).","02_FIRE DAMAGE":"Vehicle damaged by fire.","03_HAIL DAMAGE":"Vehicle damaged by hail.","04_SALT WATER DAMAGE":"Vehicle damaged by saltwater flood.","05_VANDALISM":"Vehicle damaged by vandals.","06_KIT":"A Vehicle that has been built by combining a chassis with a different (non-matching VIN) frame, engine, and body parts. The VIN on the chassis is used as the vehicle's VIN.","07_DISMANTLED":"The vehicle can only be sold as parts and cannot be legally driven.","08_JUNK":"The vehicle is incapable of safe operation for use on the roads or highways and has no resale value except as a source of parts or scrap, or the vehicle's owner has irreversibly designated the vehicle as a source of parts or scrap. This vehicle shall never be titled or registered. Also known as nonrepairable, scrapped, or destroyed.","09_REBUILT":"The vehicle previously branded \"\"salvage\"\" has passed anti-theft and safety inspections or other jurisdiction procedures to ensure the vehicle was rebuilt to required standards. Also known as prior salvage (salvaged).","10_REBUILT":"\"A vehicle that has been permanently altered from original construction by removing adding or substituting major components.\"","10_RECONSTRUCTED":"A vehicle that has been permanently altered from original construction by removing adding or substituting major components.","11_SALVAGE":"Damage or Not Specified - Any vehicle which has been wrecked destroyed or damaged to the extent that the total estimated or actual cost of parts and labor to rebuild or reconstruct the vehicle to its pre-accident condition and for legal operation on roads or highways exceeds a jurisdiction-defined percentage of the retail value of the vehicle. The retail value of the vehicle is determined by a current edition of a nationally recognized compilation (to include automated data bases) of retail values. Salvage--Damage or Not Specified also includes any vehicle to which an insurance company acquires owner- ship pursuant to a damage settlement or any vehicle that the vehicle's owner may wish to designate as a salvage vehicle by obtaining a salvage title without regard to extent of the vehicle's damage and repairs or any vehicle for which the jurisdiction cannot distinguish the reason the vehicle was designated salvage.","11_SALVAGE--DAMAGE OR NOT SPECIFIED":"\"Damage or Not Specified - Any vehicle which has been wrecked\" \"destroyed or damaged to the extent that the total estimated or actual\" cost of parts and labor to rebuild or reconstruct the vehicle to its pre-accident condition and for legal operation on roads or highways exceeds a jurisdiction-defined percentage of the retail value of the vehicle. The retail value of the vehicle is determined by a current edition of a nationally recognized compilation (to include automated data bases) of retail values. Salvage--Damage or Not Specified also includes any vehicle to which an insurance company acquires owner- ship pursuant to a damage \"settlement or any vehicle that the vehicle's owner may wish to\" \"designate as a salvage vehicle by obtaining a salvage title without\" \"regard to extent of the vehicle's damage and repairs or any vehicle\" for which the jurisdiction cannot distinguish the reason the vehicle was designated salvage.","12_TEST VEHICLE":"The vehicle is built and retained by the manufacturer or has been retrofitted by a third party for testing and may not be considered roadworthy after testing is complete.","13_REFURBISHED":"Any vehicle modified by the installation of a new cab and chassis for the existing coach which has been renovated resulting in a vehicle of greater value or a vehicle with a new style.","14_COLLISION":"Vehicle damaged by collision.","15_RESERVED":"Eliminated in favor of code 09. Code 15 was \"Prior Salvage\".","16_SALVAGE RETENTION":"The vehicle is branded salvage and is kept by the owner.","17_PRIOR TAXI":"Vehicle previously registered as a taxi.","18_PRIOR POLICE":"Vehicle previously registered as a police vehicle.","19_ORIGINAL TAXI":"Vehicle is currently registered as a taxi.","20_ORIGINAL POLICE":"Vehicle is currently registered as a police vehicle.","21_REMANUFACTURED":"Vehicle was reconstructed by the manufacturer.","22_GRAY MARKET":"Vehicle was manufactured for use outside of the United States and has been brought into the United States. Brand '22' has been replaced by brands '45' and '46' as of 6/25/01.","23_WARRANTY RETURN":"Vehicle returned to the manufacturer because of a breach in the warranty.","24_ANTIQUE":"The vehicle is over 50 years old.","25_CLASSIC":"The vehicle is over 20 years old and adheres to other jurisdiction-specific criteria e.g. vehicle make condition etc.","26_AGRICULTURAL VEHICLE":"The vehicle will primarily be operated on private roads for agricultural purposes.","27_LOGGING VEHICLE":"The vehicle will primarily be operated on private roads for logging purposes.","28_STREET ROD":"The vehicle has been modified to not conform with the manufacturer's specifications and the modifications adhere to jurisdiction-specific criteria.","29_\"VEHICLE CONTAINS REISSUED VIN\"":"The chassis VIN has been reissued i.e. the same VIN is reused.","30_REPLICA":"A vehicle with a body built to resemble and be a reproduction of another vehicle of a given year and given manufacturer.","31_TOTALED":"A vehicle that is declared a total loss by a jurisdiction or an insurer that is obligated to cover the loss or that the insurer takes possession of or title to.","32_OWNER RETAINED":"A vehicle that has been declared by the insurance company to be a total loss but the owner maintains possession and ownership of the vehicle.","33_BOND POSTED":"The insurance company has issued a bond on the vehicle because the ownership of the vehicle cannot be proven; this allows the vehicle to be sold and titled. Note: This brand is not valid after January 17, 2003.","34_MEMORANDUM COPY":"The title document is a facsimile title and not the active (original or duplicate) title document.","35_PARTS ONLY":"The vehicle may only be used for parts. This code is no longer used use '07 - Dismantled'.","36_RECOVERED THEFT":"The vehicle was previously titled as salvage due to theft. The Vehicle has been repaired and inspected (or complied with other jurisdiction procedures) and may be legally driven.","37_UNDISCLOSED LIEN":"The vehicle has entered the titling jurisdiction from a jurisdiction that does not disclose lien-holder information on the title. The titling jurisdiction may issue a new title without this brand if no notice of a security interest in the vehicle is received, within a jurisdiction defined time frame. Note: This brand is not valid after January 17, 2003.","38_\"PRIOR OWNER RETAINED\"":"A vehicle that was previously branded owner retained and was sold. The new owner's title contains this brand.","39_\"VEHICLE NON-CONFORMITY UNCORRECTED\"":"A non-safety defect reported to the jurisdiction by the vehicle manufacturer remains uncorrected.","40_\"VEHICLE NON-CONFORMITY CORRECTED\"":"A non-safety defect reported to the jurisdiction by the vehicle manufacturer has been corrected.","41_\"VEHICLE SAFETY DEFECT UNCORRECTED\"":"A safety defect reported to the jurisdiction by the vehicle manufacturer remains uncorrected.","42_\"VEHICLE SAFETY DEFECT CORRECTED\"":"A safety defect reported to the jurisdiction by the vehicle manufacturer has been corrected.","43_\"VIN REPLACED BY A NEW STATE ASSIGNED VIN\"":"A title should not be issued for the VIN. This brand can be issued for rebuilt vehicles.","45_GRAY MARKET":"Vehicle was manufactured for use outside the United States and has been brought into the United States. The vehicle is not in compliance with applicable federal standards.","46_GRAY MARKET":"Vehicle was manufactured for use outside the United States and has been brought into the United States. The vehicle is in compliance with applicable federal standards.","47_MANUFACTURER BUY":"A vehicle that has been bought back by the manufacturer under jurisdiction - defined regulations or laws, such as lemon laws. For example, the manufacturer could be obligated to buy back the vehicle when a specified number of repair attempts fails to correct a major problem on a new vehicle, or if a new vehicle has been out of service for repair for the same problem for a cumulative period of 30 days or more, within one year of purchase.","48_FORMER RENTAL":"Former Rental","49_SALVAGE--STOLEN":"Any vehicle the reporting jurisdiction considers salvage because an insurance company has acquired ownership pursuant to a settlement based on the theft of the vehicle.","50_\"SALVAGE--REASONS OTHER THAN DAMAGE OR STOLEN\"":"Any vehicle the reporting jurisdiction considers salvage based on criteria such as abandonment not covered by the Salvage-- Damage or Not Specified and Salvage--Stolen brands. Note.--Percent of damage is not reported with brand code 50.","51_DISCLOSED DAMAGE":"The vehicle has sustained damage to the extent that the damage is required to be disclosed under the jurisdiction's damage disclosure law.","52_PRIOR NON-":"A vehicle constructed by repairing a vehicle that has been destroyed Repairable /or declared to be non-repairable or otherwise declared to not be Repairedeligible for titling because of the extent of damage to the vehicle but has been issued a title pursuant to state law after falling within this criterion with this brand on the face of the certificate of title.","53_CRUSHED":"The frame or chassis of the vehicle has been crushed or otherwise destroyed so that it is physically impossible to use it in constructing a vehicle.","54_INOPERABLE VEHICLE":"A motor vehicle that is substantially disassembled and for this reason is mechanically unfit or unsafe to be operated or moved upon a public street, highway, or public vehicular area. An \"inoperable vehicle\" has not been identified as either \"junk\" or \"salvage\". Inoperable vehicles may be titled, but no registration may be issued until such time that the vehicle has been determined roadworthy according to state regulations.","55_HAZARDOUS SUBSTANCE":"Hazardous Substance Contaminated Vehicle - The jurisdiction has determined that the vehicle has been contaminated by a hazardous substance and is unsafe for use. Excluding flood damaged vehicles.<br><br>A 'hazardous substance' is any substance that could diminish the safety of the vehicle or cause injury to its occupants. The 'hazardous substance' has one or more, but is not limited to the following intrinsic 'hazardous properties':<ul><li>Explosiveness</li><li>Flammability</li><li>Ability to oxidize (accelerate a fire)</li><li>Human toxicity (acute or chronic)</li><li>Corrosiveness (to human tissue or metal)</li><li>Eco toxicity (with or without bioaccumulation)</li><li>Capacity, on contact with air or water, to develop one or more of the above properties.</li></ul>","56_EXPORT ONLY VEHICLE":"A salvage or junk vehicle determined for exportation outside of the United States and/or its territories, is not eligible for re-title/re-registration for on-road use in the United States.","68_ACTUAL":"The true mileage for the vehicle. The odometer has not been tampered with reached its mechanical limits or been altered.","69_NOT ACTUAL":"The odometer reading is known to be other than the true mileage for the vehicle.","70_NOT ACTUAL":"Odometer tampering verified - The odometer reading is known to be other that the true mileage for the vehicle due to tampering.","71_\"EXEMPT FROM ODOMETER DISCLOSURE\"":"The vehicle falls within criteria that allow it to change ownership without disclosure of the odometer reading.","72_\"EXCEEDS MECHANICAL LIMITS\"":"The odometer reading is less than the true mileage of the vehicle because the odometer can not display the total number of true miles.","73_\"ODOMETER MAY BE ALTERED\"":"The titling authority has reason to believe that the odometer reading does not reflect the true mileage of the vehicle because of an alteration to the odometer.","74_ODOMETER REPLACED":"The odometer in the vehicle is not the odometer put in the vehicle when manufactured.","75_\"READING AT TIME OF RENEWAL\"":"The odometer reading was recorded when the registration was renewed.","76_\"ODOMETER DISCREPANCY\"":"The titling authority has reason to believe that the odometer reading does not reflect the true mileage of the vehicle because of known previous recorded values of odometer for the vehicle.","77_CALL TITLE DIVISION":"The titling authority knows of some problem with the odometer reading that it cannot print on a title. Titling authority will discuss the problem (manual process) with authorized inquirers.","78_\"RECTIFY PREVIOUS EXCEEDS MECHANICAL LIMITS BRAND\"":"A state other than the brander corrected brand 72.","90_PENDING JUNK":"CARS.gov - The National Highway Traffic Safety Administration (NHTSA) Consumer Assistance to Recycle and Save (CARS) program is processing an application which, if approved, will render this vehicle incapable of operating on public streets, roads, and highways. The vehicle will have no value except as a source of parts or scrap, shall be crushed or shredded within a specified time period (including the engine block), and shall not be exported prior to crushing or shredding. For additional information concerning the CARS program visit CARS.gov.","91_JUNK AUTOMOBILE -":"CARS.gov - Pursuant to the Consumer Assistance to Recycle and Save Act of 2009 (CARS) this vehicle is incapable of operating on public streets, roads, and highways. The vehicle has no value except as a source of parts or scrap, shall be crushed or shredded within a specified time period\n(including the engine block), and shall not be exported prior to crushing or shredding. For additional information concerning the CARS program visit CARS.gov.\n"},"00_CLEAR":"Clear","01_FLOOD DAMAGE":"Flood damage","02_FIRE DAMAGE":"Fire damage","03_HAIL DAMAGE":"Hail damage","04_SALT WATER DAMAGE":"Salt water damage","05_VANDALISM":"Vandalism","06_KIT":"Kit","07_DISMANTLED":"Dismantled","08_JUNK":"Junk","09_REBUILT":"Rebuilt","10_REBUILT":"Reconstructed","10_RECONSTRUCTED":"Reconstructed","11_SALVAGE":"Salvage","11_SALVAGE--DAMAGE OR NOT SPECIFIED":"Salvage","12_TEST VEHICLE":"Test Vehicle","13_REFURBISHED":"Refurbished","14_COLLISION":"Collision","15_RESERVED":"Reserved","16_SALVAGE RETENTION":"Salvage Retention","17_PRIOR TAXI":"Prior Taxi","18_PRIOR POLICE":"Prior Police","19_ORIGINAL TAXI":"Original Taxi","20_ORIGINAL POLICE":"Original Police","21_REMANUFACTURED":"Remanufactured","22_GRAY MARKET":"Gray Market","23_WARRANTY RETURN":"Warranty Return","24_ANTIQUE":"Antique","25_CLASSIC":"Classic","26_AGRICULTURAL VEHICLE":"Agricultural Vehicle","27_LOGGING VEHICLE":"Logging Vehicle","28_STREET ROD":"Street Rod","29_\"VEHICLE CONTAINS REISSUED VIN\"":"Vehicle Contains Reissued VIN","30_REPLICA":"Replica","31_TOTALED":"Totaled","32_OWNER RETAINED":"Owner Retained","33_BOND POSTED":"Bond Posted","34_MEMORANDUM COPY":"Memorandum Copy","35_PARTS ONLY":"Parts Only","36_RECOVERED THEFT":"Recovered Theft","37_UNDISCLOSED LIEN":"Undisclosed Lien","38_\"PRIOR OWNER RETAINED\"":"Prior Owner Retained","39_\"VEHICLE NON-CONFORMITY UNCORRECTED\"":"Vehicle Non-conformity Uncorrected","40_\"VEHICLE NON-CONFORMITY CORRECTED\"":"Vehicle Non-conformity Corrected","41_\"VEHICLE SAFETY DEFECT UNCORRECTED\"":"Vehicle Safety Defect Uncorrected","42_\"VEHICLE SAFETY DEFECT CORRECTED\"":"Vehicle Safety Defect Corrected","43_\"VIN REPLACED BY A NEW STATE ASSIGNED VIN\"":"VIN replaced by a new state assigned VIN","45_GRAY MARKET":"Gray Market","46_GRAY MARKET":"Gray Market","47_MANUFACTURER BUY":"Manufacturer Buy","48_FORMER RENTAL":"Former Rental","49_SALVAGE--STOLEN":"Salvage - Stolen","50_\"SALVAGE--REASONS OTHER THAN DAMAGE OR STOLEN\"":"Salvage - Reasons Other Than Damage or Stolen","51_DISCLOSED DAMAGE":"Disclosed Damage","52_PRIOR NON-":"Prior Non-Repairable / Repaired","53_CRUSHED":"Crushed","54_INOPERABLE VEHICLE":"Inoperable Vehicle","55_HAZARDOUS SUBSTANCE":"Hazardous substance","56_EXPORT ONLY VEHICLE":"Export only vehicle","68_ACTUAL":"Actual","69_NOT ACTUAL":"Not Actual","70_NOT ACTUAL":"Not Actual","71_\"EXEMPT FROM ODOMETER DISCLOSURE\"":"Exempt from Odometer Disclosure","72_\"EXCEEDS MECHANICAL LIMITS\"":"Exceeds Mechanical Limits","73_\"ODOMETER MAY BE ALTERED\"":"Odometer may be Altered","74_ODOMETER REPLACED":"Odometer Replaced","75_\"READING AT TIME OF RENEWAL\"":"Reading at Time of Renewal","76_\"ODOMETER DISCREPANCY\"":"Odometer Discrepancy","77_CALL TITLE DIVISION":"Call Title Division","78_\"RECTIFY PREVIOUS EXCEEDS MECHANICAL LIMITS BRAND\"":"Rectify Previous Exceeds Mechanical Limits Brand","90_PENDING JUNK":"Pending Junk Automobile","91_JUNK AUTOMOBILE -":"Junk Automobile "},"NMVTISDISCLAIMER":{"NMVTIS CONSUMER ACCESS PRODUCT DISCLAIMER":"NMVTIS Consumer Access Product Disclaimer","PARAGRAPH1":"The National Motor Vehicle Title Information System (NMVTIS) is an electronic system that contains information on certain automobiles titled in the United States. NMVTIS is intended to serve as a reliable source of title and <a href=\"https://vehiclehistory.bja.ojp.gov/nmvtis_glossary\" target=\"_blank\">brand</a> history for automobiles, but it does not contain detailed information regarding a vehicles repair history.","PARAGRAPH10":"Information from insurance companies, and auto recyclers, including junk and salvage yards, that is required by law to be reported to the system, beginning March 31, 2009. This information will include if the vehicle was determined to be a total loss by an insurance carrier.","PARAGRAPH11":"Information from junk and salvage yards receiving a cash for clunker vehicle traded-in under the Consumer Assistance to Recycle and Save Act of 2009 (CARS) Program.","PARAGRAPH12":"Consumers are advised to visit <a href=\"https://vehiclehistory.bja.ojp.gov\" target=\"_blank\">vehiclehistory.bja.ojp.gov</a> for details on how to interpret the information in the system and understand the meaning of various labels applied to vehicles by the participating state motor vehicle titling agencies.","PARAGRAPH2":"All states, insurance companies, and junk and salvage yards are required by federal law to regularly report information to NMVTIS. However, NMVTIS does not contain information on all motor vehicles in the United States because <a href=\"https://vehiclehistory.bja.ojp.gov/nmvtis_states\" target=\"_blank\">some states</a> are not yet providing their vehicle data to the system. Currently, the data provided to NMVTIS by states is provided in a variety of time frames; while some states report and update NMVTIS data in real-time (as title transactions occur), other states send updates less frequently, such as once every 24 hours or within a period of days.","PARAGRAPH3":"Information on previous, significant vehicle damage may not be included in the system if the vehicle was never determined by an insurance company (or other appropriate entity) to be a total loss or branded by a state titling agency. Conversely, an insurance carrier may be required to report a total loss even if the vehicles titling-state has not determined the vehicle to be salvage or junk.","PARAGRAPH4":"A vehicle history report is NOT a substitute for an independent vehicle inspection. Before making a decision to purchase a vehicle, consumers are <strong>strongly encouraged to also obtain an independent vehicle inspection</strong> to ensure the vehicle does not have hidden damage. The <a href=\"https://vehiclehistory.bja.ojp.gov/nmvtis_vehiclehistory\" target=\"_blank\">Approved NMVTIS Data Providers</a> (look for the NMVTIS logo) can include vehicle condition data from sources other than NMVTIS.","PARAGRAPH5":"NMVTIS data <strong>INCLUDES</strong> (as available by those entities required to report to the System):","PARAGRAPH6":"Information from <a href=\"https://vehiclehistory.bja.ojp.gov/nmvtis_states\" target=\"_blank\">participating</a> state motor vehicle titling agencies.","PARAGRAPH7":"Information on automobiles, buses, trucks, motorcycles, recreational vehicles, motor homes, and truck tractors. NMVTIS may not currently include commercial vehicles if those vehicles are not included in a states primary database for title records (in some states, those vehicles are managed by a separate state agency), although these records may be added at a later time.","PARAGRAPH8":"Information on brands applied to vehicles provided by participating state motor vehicle titling agencies. Brand types and definitions vary by state, but may provide useful information about the condition or prior use of the vehicle.","PARAGRAPH9":"Most recent odometer reading in the states title record."}}}}
